import React from "react";

function Character({ characters, loading }: any) {
  if (loading) {
    return <h2>Loading...</h2>;
  }

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Race</th>
          <th>gender</th>
          <th>wikiUrl</th>
          <th>birth</th>
        </tr>
      </thead>
      <tbody>
        {characters.map((character: any) => (
          <li key={character.id}>{character.name}</li>
        ))}
      </tbody>
    </table>
  );
}

export default Character;
